@Override
public int hashCode() {
  int result;
  long temp;
  result = queryPoint.hashCode();
  temp = Double.doubleToLongBits(multiplier);
  result = 31 * result + (int) (temp ^ (temp >>> 32));
  result = 31 * result + distCalc.hashCode();
  temp = Double.doubleToLongBits(nullValue);
  result = 31 * result + (int) (temp ^ (temp >>> 32));
  return result;
}

